import React from 'react';

import { Typography, Box } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import { Header } from '../../components';
//import { Link } from 'react-router-dom';

const useStyles = makeStyles((theme) => ({
    wrapper: {
        display: 'flex',
        alignItems: 'center',
        flexDirection:'column',
        paddingTop:'20px'
    },
    link: {
        textDecoration: 'none',
        color: '#000',
    },
    titleFormat: {
        paddingBottom:'10px',
        textDecoration: "none",
        color:'#212F3C',
        //fontFamily: '-apple-system',
    },
    titleParagraphFormat: {
        fontFamily: '-apple-system',
        paddingTop:'10px',
    },
    boxFormat: {
        width: '80%',
        paddingBottom:'30px',
    },
}));

const Proposal = ({ tagChange }) => {
    const classes = useStyles();
    //const theme = useTheme();

    return (
        <div className={classes.wrapper}>
            <Header></Header>
            <Box className={classes.boxFormat}>
            <Typography align='center' variant='h5' className={classes.titleFormat}>
                Problem Statement
            </Typography>
            <Typography align='center' variant='subtitle1' className={classes.titleParagraphFormat}>
            When someone uses our system, they are expected to input images of house numbers displayed on streets. These images should be taken from a camera, or extracted from Google street view, with random background and diverse colors, but have the house numbers locating in the middle. The desired output is the same image with detected house numbers labeled besides the actual house numbers.
            </Typography>
            </Box>
        </div>
    )
}

export default Proposal;
